import React, {Component} from 'react'
class ProcessLog extends Component{
  render(){
    if (this.props.data){
      console.log("ok true--logs");
      var logdata = this.props.data.map(function(logs){
        return <div key={logs.time}><h5>{logs.user_id}</h5><ul>
        <li>{logs.type}</li>
        <li>{logs.revenue}</li>
        </ul></div>
      })
    console.log(logdata);
    }
    return(
      <section id='processlog'>
        <div className="row logs">
          <h6>LOGS</h6>
          {logdata}
        </div>
      </section>
    );
  }
}
export default ProcessLog
